import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header className="bg-blue-600 text-white p-4 flex justify-between items-center">
      <h1 className="font-bold text-xl">Real Estate</h1>
      <nav>
        <Link to="/" className="mx-2 hover:underline">Home</Link>
        <Link to="/buy" className="mx-2 hover:underline">Buy</Link>
        <Link to="/rent" className="mx-2 hover:underline">Rent</Link>
        <Link to="/sell" className="mx-2 hover:underline">Sell</Link>
      </nav>
    </header>
  );
};

export default Header;
